import React, { Component } from 'react';
import PropTypes from 'prop-types';

import MapFieldComponent from './MapFieldComponent';
import MapComponent from "./MapComponent";

export default class AdminMapManager extends Component {
    constructor(props) {
        super(props);

        this.state = {
            fields: {
                11: {
                    x: 0,
                    y: 0,
                },

                12: {
                    x: 0,
                    y: 0,
                },
            },
        };
    }

    move(fieldId, dx, dy) {
        const movedField = {
            x: dx + this.state.fields[fieldId].x,
            y: dy + this.state.fields[fieldId].y,
        };

        console.log(movedField.x, movedField.y);

        this.setState({ fields: { ...this.state.fields, [fieldId]: movedField } });
    }

    render() {
        return (
            <div>
                <MapFieldComponent
                    teamId={1}
                    teamColor="red"
                    regionName="niceRegion"
                    distance={2}
                    scale={0.1}
                    fieldId={12}
                    isFortress={false}
                    positionX={400}
                    positionY={200}
                    translationX={this.state.fields[12].x}
                    translationY={this.state.fields[12].y}
                    innerImage="data:image/png;base64,"
                    isMovable
                    move={(x, y) => this.move(12, x, y)}
                />
                <MapFieldComponent
                    teamId={2}
                    teamColor="green"
                    regionName="niceRegion"
                    distance={3}
                    scale={0.2}
                    fieldId={11}
                    isFortress={false}
                    positionX={400}
                    positionY={500}
                    translationX={this.state.fields[11].x}
                    translationY={this.state.fields[11].y}
                    innerImage="data:image/png;base64,"
                    isMovable
                    move={(x, y) => this.move(11, x, y)}
                />

                <MapComponent databaseObjects={this.props.databaseObjects} />
            </div>
        );
    }
}

AdminMapManager.propTypes = {
    databaseObjects: PropTypes.object.isRequired,
};
